import React from "react";

const BalancesView = props => {
  return (
    <div className="balances-page">
      <div className="balances-info">
        <h4>Total Balance</h4>
        <h4>Total Owed</h4>
        <h4>Total You Are Owed</h4>
      </div>

      <div className="user-owes">
        <h3>You Owe</h3>
      </div>

      <div className="user-is-owed">
        <h3>You Are Owed</h3>
      </div>
    </div>
  );
};

export default BalancesView;
